comment: |-
  SELECT T2.name,
         T2.capacity
  FROM concert AS T1
  JOIN stadium AS T2 ON T1.stadium_id = T2.stadium_id
  WHERE T1.year >= 2014
  GROUP BY T2.stadium_id
  ORDER BY count(*) DESC
  LIMIT 1

sql: |-
  SELECT T2.name,
         T2.capacity
